import React from "react";
import styled from "styled-components";

const NavigationBar = styled.div`
  margin: 0;
  .nav {
    max-width: 1280px;
    height: 120px;
    display: flex;
    justify-content: space-between;
    align-items: center;
    padding-left: 40px;
    padding-right: 40px;
  }
  .menu {
    display: flex;
    list-style: none;
    padding: 0;
    margin: 0;
  }
  .menu li:not(:nth-child(1)) {
    padding-left: 32px;
  }
  .menu li a {
    text-decoration: none;
  }
`;
function Navbar() {
  return (
    <NavigationBar>
      <div className="nav">
        <span>Endless Creation</span>
        <ul className="menu">
          <li>
            <a href="#">Activity</a>
          </li>
          <li>
            <a href="#">Project</a>
          </li>
          <li>
            <a href="#">Member</a>
          </li>
          <li>
            <a href="#">community</a>
          </li>
        </ul>
        <div class="nav_Toggle_Position">
          <a href="#" className="nav_Toggle">
            <span></span>
            <span></span>
            <span></span>
            <span></span>
          </a>
        </div>
      </div>
    </NavigationBar>
  );
}

export default Navbar;
